import React from "react";
function VideoRow({views,subs,description,timestamp,channel,title,image}){
    return(
        <div className="videorow">
            <img src={image}></img>
            <div className="videorow_text">
                <h3>{title}</h3>
                <p>{views} views.{subs} subscribers</p>
                <p>{description}</p>
            </div>
        </div>
    )
}
